import React from 'react';

const SearchMovie = () => {
    return (
        <div id='content'>
            <form className='form-control'>
                <label>MOVIE NAME</label>
                <input type='text' name='query' required/>
                <button type='submit'>Search</button>
            </form>
        </div>
    )
}

export default SearchMovie;
